import { StyleSheet } from "@react-pdf/renderer"

import global from "./global"

export default StyleSheet.create({
  ...global,

  container: {
    display: "flex",
    margin: "10 auto",
    margin: "20 auto",
    height: "auto",
  },

  heading: {
    letterSpacing: 1.5,
    fontSize: 11,
    textTransform: "uppercase",
    marginBottom: 20,
    color: "#d4b88a",
  },

  interests: {
    lineHeight: 1.8,
    textTransform: "uppercase",
    letterSpacing: -0.1,
  },
})
